INSERT INTO `blogdata` VALUES (58, 'vue项目设置动态样式', '**这篇文章主要介绍了vue如何动态设置class、动态设置style，具有很好的参考价值，希望对大家有所帮助。如有错误或未考虑完全的地方，望不吝赐教**\nvue动态设置class、style\n```js\n//动态class对象\n<div :class=\"{ \'isActive\': true, \'red\': isRed }\"></div>\n//动态style对象\n<div :style=\"{ color: bgColor, fontSize: \'18px\' }\"></div>\n//动态class数组\n<div :class=\"[\'is-active\', isRed ? \'red\' : \'\' ]\"></div>\n//动态style数组\n<div :style=\"[{ color: bgColor, fontSize: \'18px\' }, { fontWeight: \'500\' }]\"></div>\n```', '前端', '2024-02-21');
INSERT INTO `blogdata` VALUES (59, 'vue项目修改log', '**第一种方案**\n在public目录中的index.html\n<link rel=\"icon\" href=\"<%= BASE_URL %>favicon.ico\">\n图标的位置 public/favicon.icon\n\n**第二种方案**\n标题和图片在store中保存了\n在main.js中引入 封装好的js文件\n```js\nimport store from \"../store\";\nexport function getLogo() {\n  var link = document.querySelector(\"link[rel=\'icon\']\" || document.createElement(\"link\"));\n  link.rel = \"icon\";\n  link.href = store.state.webConfig.webConfig.webIcon;\n  document.getElementsByTagName(\"head\")[0].appendChild(link); //修改logo\n  if (store.state.webConfig.webConfig.webName) {\n    document.title = store.state.webConfig.webConfig.webName; //修改标题\n  } else {\n    document.title = \"登录页\";\n  }\n}\n\n```\n', '前端', '2024-02-21');
INSERT INTO `blogdata` VALUES (61, '防抖和节流', '**防抖(debounce)**\n```js\n// 防抖\nexport default function debounce(fn, time) {\n  time = time || 200\n  // 定时器\n  let timer = null\n  return function(...args) {\n    var _this = this\n    if (timer) {\n      clearTimeout(timer)\n    }\n    timer = setTimeout(function() {\n      timer = null\n      fn.apply(_this, args)\n    }, time)\n  }\n}\n```\n**节流(throttle)**\n```js\n// 节流\nexport default function throttle(fn, time) {\n  let timer = null\n  time = time || 1000\n  return function(...args) {\n    if (timer) {\n      return\n    }\n    const _this = this\n    timer = setTimeout(() => {\n      timer = null\n    }, time)\n    fn.apply(_this, args)\n  }\n}\n```\n**页面使用**\n```vue\n<el-button @click=\"clickDebounce\">防抖</el-button>\n<el-button @click=\"clickThrottle\">节流</el-button>\n```\n```vue\n//引用定义好的JS方法\nimport debounce from \'@/utils/debounce\'\nimport throttle from \'@/utils/throttle\'\nmethods: {\n    clickDebounce: debounce((e) => {\n      console.log(1)\n    }, 1000),\n    clickThrottle: throttle((e) => {\n      console.log(2)\n    }, 1000),\n}\n```\n', '前端', '2024-02-21');
INSERT INTO `blogdata` VALUES (62, '直播流播放方案', '首先在项目的根目录下找到public文件夹，然后再public文件夹下方的index.html，引入jessibuca.js\n[jessibuca压缩包](https://pan.baidu.com/s/1Qzd4lSPeLttEXOf7F9FT_w?pwd=y3iw)\n\n![](https://winterfinale.com:1220/avatar/avatar-1708486189046.jpg)\n\npublic/index.html页面引入\n\n![](https://winterfinale.com:1220/avatar/avatar-1708486470354.jpg)\n\n我将这个播放器封装为一个组件，名为jessibuca.vue,在父组件引入后给defaultUrl传播放地址和其他参数即可。\n```vue\n<template>\n  <div :id=\"[\'container\'+id]\" class=\"player\" style=\"width:100%; height:100%\"></div>\n</template>\n\n<script>\nexport default {\n  props: {\n    id: {\n      type: String,\n      default: \"1\",\n    },\n    isAutoPlay: {\n      type: Boolean,\n      default: true,\n    },\n    defaultUrl: {\n      type: String,\n      default: \"\",\n    },\n    width: {\n      type: [Number, String],\n      default: \"100%\",\n    },\n    height: {\n      type: [Number, String],\n      default: \"100%\",\n    },\n    listener: {\n      type: Function,\n      default() {\n        return function (msg) {};\n      },\n    },\n    live: {\n      type: Boolean,\n      default: true,\n    },\n    options: {\n      type: Object,\n    },\n  },\n  data() {\n    return {\n      jessibuca: null,\n      version: \"\",\n      wasm: false,\n      vc: \"ff\",\n      quieting: true,\n      showOperateBtns: false,\n      showBandwidth: false,\n      err: \"\",\n      speed: 0,\n      performance: \"\",\n      volume: 1,\n      rotate: 0,\n      recordType: \"webm\",\n      scale: 0,\n      url: this.defaultUrl,\n      data: null,\n      isNotMute: false,\n    };\n  },\n  mounted() {\n    console.log(\"播放器地址\", this.url);\n    this.create();\n    // window.onerror = (msg) => (this.err = msg);\n  },\n  unmounted() {\n    this.jessibuca.destroy();\n  },\n  destroyed() {\n    console.log(\"销毁播放器\");\n    this.jessibuca.destroy();\n  },\n  methods: {\n    load(url, data) {\n      //被父组件调用后播放\n      this.data = data;\n      this.url = url;\n      this.create();\n    },\n    create(options) {\n      options = options || {};\n      this.jessibuca = new window.Jessibuca(\n        Object.assign(\n          {\n            container: document.getElementById(\"container\" + this.id),\n            videoBuffer: Number(0.2), // 缓存时长\n            isResize: false,\n            useWCS: this.useWCS,\n            useMSE: this.useMSE,\n            text: \"\",\n            // background: \"bg.jpg\",\n            loadingText: \"加载中...\",\n            // hasAudio:false,\n            debug: false,\n            supportDblclickFullscreen: true,\n            showBandwidth: true, // 显示网速\n            operateBtns: {\n              fullscreen: true,\n              screenshot: true,\n              play: true,\n              audio: true,\n            },\n            vod: this.vod,\n            forceNoOffscreen: !this.useOffscreen,\n            isNotMute: this.isNotMute,\n            timeout: 10,\n          },\n          options\n        )\n      );\n\n      var _this = this;\n      this.jessibuca.on(\"load\", function () {});\n\n      this.jessibuca.on(\"log\", function (msg) {});\n\n      this.jessibuca.on(\"record\", function (msg) {\n        console.log(\"on record:\", msg);\n      });\n\n      this.jessibuca.on(\"pause\", function () {\n        // _this.playing = false;\n      });\n\n      this.jessibuca.on(\"fullscreen\", function (msg) {});\n\n      this.jessibuca.on(\"mute\", function (msg) {\n        _this.quieting = msg;\n      });\n\n      this.jessibuca.on(\"audioInfo\", function (msg) {\n        // console.log(\"audioInfo\", msg);\n      });\n\n      // this.jessibuca.on(\"bps\", function (bps) {\n      //   // console.log(\'bps\', bps);\n      // });\n      // let _ts = 0;\n      // this.jessibuca.on(\"timeUpdate\", function (ts) {\n      //     console.log(\'timeUpdate,old,new,timestamp\', _ts, ts, ts - _ts);\n      //     _ts = ts;\n      // });\n\n      this.jessibuca.on(\"videoInfo\", function (info) {\n        // console.log(\"videoInfo\", info);\n      });\n\n      this.jessibuca.on(\"error\", function (error) {\n        // _this.$message.error(\"获取视频错误\");\n      });\n\n      this.jessibuca.on(\"timeout\", function () {\n        _this.$message.error(\"获取视频超时\");\n      });\n\n      this.jessibuca.on(\"start\", function () {\n        // console.log(\'frame start\');\n      });\n\n      this.jessibuca.on(\"performance\", function (performance) {\n        var show = \"卡顿\";\n        if (performance === 2) {\n          show = \"非常流畅\";\n        } else if (performance === 1) {\n          show = \"流畅\";\n        }\n        _this.performance = show;\n      });\n      this.jessibuca.on(\"buffer\", function (buffer) {\n        // console.log(\'buffer\', buffer);\n      });\n\n      this.jessibuca.on(\"stats\", function (stats) {\n        // console.log(\'stats\', stats);\n      });\n\n      this.jessibuca.on(\"kBps\", function (kBps) {\n        // console.log(\'kBps\', kBps);\n      });\n\n      this.jessibuca.on(\"play\", () => {\n        // this.playing = true;\n        // this.loaded = true;\n        _this.quieting = _this.jessibuca.isMute();\n      });\n\n      this.jessibuca.on(\"recordingTimestamp\", (ts) => {\n        // console.log(\'recordingTimestamp\', ts);\n      });\n\n      this.jessibuca.play(this.url);\n      // console.log(this.jessibuca);\n    },\n    // play() {\n    //   // this.jessibuca.onPlay = () => (this.playing = true);\n\n    //   // if (this.$refs.playUrl.value) {\n    //     // this.jessibuca.play(this.$refs.playUrl.value);\n    //     this.jessibuca.play(\"https://flvplayer.js.org/assets/video/weathering-with-you.flv\");\n    //   // }\n    // },\n    mute() {\n      // this.isNotMute = false\n      //jessibuca.isMute()\n      this.jessibuca.mute();\n    },\n    cancelMute() {\n      // this.isNotMute = true\n      this.jessibuca.cancelMute();\n    },\n    pause() {\n      console.log(\"暂停\");\n      this.jessibuca.pause();\n      // this.playing = false;\n      this.err = \"\";\n      this.performance = \"\";\n    },\n    volumeChange() {\n      this.jessibuca.setVolume(this.volume);\n    },\n    rotateChange() {\n      this.jessibuca.setRotate(this.rotate);\n    },\n    destroy() {\n      if (this.jessibuca) {\n        this.jessibuca.destroy();\n      }\n      this.create();\n      // this.playing = false;\n      // this.loaded = false;\n      this.performance = \"\";\n    },\n    fullscreen() {\n      if (!this.jessibuca) return;\n      return this.jessibuca.setFullscreen(true);\n    },\n    clearView() {\n      this.jessibuca.clearView();\n    },\n    close() {\n      if (!this.jessibuca) return;\n      return this.reset();\n    },\n    // startRecord() {\n    //   const time = new Date().getTime();\n    //   this.jessibuca.startRecord(time, this.recordType);\n    // },\n\n    // stopAndSaveRecord() {\n    //   this.jessibuca.stopRecordAndSave();\n    // },\n    reset() {\n      if (this.jessibuca) {\n        this.jessibuca.destroy();\n      }\n      this.jessibuca = null;\n      this.url = \"\";\n    },\n    screenShot() {\n      this.jessibuca.screenshot();\n    },\n    status() {\n      return this.jessibuca && this.jessibuca.isPlaying();\n    },\n  },\n};\n</script>\n\n<style lang=\"scss\" scoped>\n.player {\n  min-width: 200px;\n  min-height: 200px;\n  background: url(\"../../assets/icon/camera.png\") center center no-repeat #353535;\n  background-size: 100% 100%;\n}\n</style>\n\n\n```\n', '前端', '2024-02-22');
INSERT INTO `blogdata` VALUES (63, 'echart重复渲染问题', 'echart重复渲染建议销毁之前创建的实例避免冲突，使用dispose()来解决。\n通常我们还会监听窗口大小来改变echart图表的大小，监听      window.addEventListener(\"resize\", () => {}）时要注意如果没有使用dispose来销毁之前的实例，则会遇到警告Instance ec_XXX has been disposed。\n具体参考以下代码\n```vue\n<template>\n  <div ref=\"cake\" class=\"cake\"></div>\n</template>\n  \n  <script>\nimport * as echarts from \"echarts\";\n\nexport default {\n  props: {\n    data: Array,\n  },\n\n  mounted() {},\n  methods: {\n    initEchart() {\n      //获取渲染饼状图的DOM(标签)\n      const cakeDom = this.$refs.cake;\n      if (this.initChart) {\n        window.removeEventListener(\"resize\", this.initChart.resize);\n        this.initChart.dispose();\n      }\n      //初始化饼状图\n      const myChart = echarts.init(cakeDom);\n      this.initChart = myChart;\n\n      //饼图的配置项\n      const option = {\n        width: \"auto\",\n        height: \"auto\",\n        tooltip: {\n          trigger: \"item\",\n        },\n        color: [\"#8dc149\", \"#38f3f5\", \"#009bf7\", \"#e53e30\"],\n        series: [\n          {\n            name: \"Access From\",\n            type: \"pie\",\n            radius: \"50%\",\n            data: this.data,\n            emphasis: {\n              itemStyle: {\n                shadowBlur: 10,\n                shadowOffsetX: 0,\n                shadowColor: \"rgba(0, 0, 0, 0.5)\",\n              },\n            },\n          },\n        ],\n      };\n      window.addEventListener(\"resize\", () => {\n        this.initChart.resize();\n      });\n      //设置饼图的配置项目\n      option && myChart.setOption(option);\n      // window.onresize = myChart.resize;\n    },\n  },\n};\n</script>\n  \n  <style scoped lang=\"scss\">\n::v-deep .canvas {\n  width: 200px;\n  display: flex;\n  flex-direction: column;\n  justify-content: center;\n  align-items: center;\n}\n.cake {\n  height: 100%;\n  width: 100%;\n  display: flex;\n  flex-direction: column;\n  justify-content: center;\n  align-items: center;\n}\n</style>\n```\n', '前端', '2024-02-21');
INSERT INTO `blogdata` VALUES (64, '云服务器部署项目', '## 使用腾讯云服务器完成把前后端项目和数据库都放置在服务器上\n\n首先，买一个服务器，最好选 Linux 系统，占用磁盘空间小，我这里选的操作系统是 Ubuntu，\n\n<img src=\"https://winterfinale.com:1220/avatar/avatar-1708502405594.jpg\" style=\"display:block\" alt=\"#\">\n\n然后需要重置一次密码\n\n在防火墙把一个要用的端口规则加上\n\n- 80 端口用于配置 nginx 服务\n- 3306 端口用于连接 MySQL 数据库\n- 3000 端口是启动项目的端口\n- 22 端口用于 ssh 远程连接服务器，一般默认会开启\n  <img src=\"https://winterfinale.com:1220/avatar/avatar-1708502521512.jpg\" style=\"display:block\" alt=\"#\">\n  为了拥有最高权限，方便操作，我们使用 root 用户连接。\n\n但是 Ubuntu 实例默认禁用 root 用户通过密码 SSH 远程登录，如需开启，需要手动配置文件（配置文件这里就不做说明了，网上可查）。\n\n####使用 scp 进行远程服务器连接，然后就可以传输文件了\n\n新建站点，输入对应的主机名、账号和密码，修改文件时可能遇到权限不够，更改高级设置即可（网上可查）\n\n<img src=\"https://winterfinale.com:1220/avatar/avatar-1708502576230.jpg\" style=\"display:block\" alt=\"#\">\n\n#### 安装和配置软件，nginx、MySQL 数据库、git、node、设置淘宝镜像、pm2 用于后台启动端口。\n\n修改 nginx 设置\n```config\n        server\n        {\n            listen 80;\n            server_name localhost;\n            index index.html index.htm index.php;\n            root  /www/server/nginx/html/dist;\n            #error_page   404   /404.html;\n            include enable-php.conf;\n             location /api/ {\n            proxy_pass http://localhost:3000/;     #反向代理配置，将请求转发到指定服务\n            }\n\n        location ~ .*.(gif|jpg|jpeg|png|bmp|swf)$\n        {\n            expires      30d;\n        }\n\n        location ~ .*.(js|css)?$\n        {\n            expires      12h;\n        }\n\n        location ~ /.\n        {\n            deny all;\n        }\n\n        access_log  /www/wwwlogs/access.log;\n    }\n    include /www/server/panel/vhost/nginx/*.conf;\n\n```\n\n然后启动 nigix，将 dist 文件夹上传至/www/server/nginx/html/即可。\n\n### 然后是后端部署\n\n文件上传上去后 pm2 start app.js 启动就行， pm2 能保证窗口管理后端项目也还在运行\n\n数据库有点麻烦，需要使用 dockor，我直接用宝塔安装了。\n\n### 使用域名访问网站\n\n由于域名还没有备案，暂时没有使用域名解析\n\n<img src=\"https://winterfinale.com:1220/avatar/avatar-1708502622257.jpg\" style=\"display:block\" alt=\"#\">\n\n#### 给网站加上 https\n\n当我们在上一个步骤使用域名访问网站时会发现浏览器的左上角会提升“不安全”字样，这是因为我们当前使用的是 http 协议，只有使用了 https 协议浏览器才不会出现上述“不安全”字样。\n\n- 执行 systemctl stop nginx 命令，这个是为了停止 nginx 服务\n- 执行 yum install -y certbot 命令，给网站添加 https 需要先申请证书，这个命令是安装申请证书的程序，使用这个程序申请的证书有效期为三个月，到期后需要重新申请。\n- 执行 certbot certonly --standalone --email 邮箱 --agree-tos -d www.你自己的域名 命令，使用这个命令申请证书（如果需要输入 yes/no 那么输入 y 就可以了）\n- 打开/etc/nginx/nginx.conf 文件，在 36 行的下面添加下面代码块中的代码。\n- 在/var 目录创建 zzz 文件夹并将自己写的 index.html 放到/var/zzz 目录。\n- 最后执行命令 systemctl restart nginx 命令，这个是用来重启 nginx 服务的。这时我们可以看到网站不会再显示“不安全”字样了。\n- 第一个 server 框中的代码的含义：nginx 服务会监听 server_name 对应的域名下来自 80 端口的请求（http 请求），并将这个请求重写到 443 端口（https 请求）\n- 第二个 server 框中 ssl_certificate、ssl_certificate_key、ssl_certificate_key 是用来配置 https 协议的。\n- 最后 location 对应的值说明 server_name 对应域名下所有来自 443 端口的请求，都会转到/var/zzz 这个目录，其中网站首页对应/var/zzz 文件夹的 index.html 这个文件。\n-\n```config\n server\n        {\n                    listen       80;\n        server_name  你自己的域名;\n        rewrite ^(.*)$ https://你自己的域名$1 permanent;\n        }\n        server\n       {\n        listen 443 ssl;\n        server_name 你自己的域名;\n        ssl_certificate /etc/letsencrypt/live/你自己的域名/fullchain.pem;\n        ssl_certificate_key /etc/letsencrypt/live/你自己的域名/privkey.pem;\n        ssl_trusted_certificate /etc/letsencrypt/live/你自己的域名/chain.pem;\n        location / {\n                root        /var/zzz;\n                index       index.html;\n        }\n        }\n```    \n', '服务器', '2024-02-21');

